import {Component, OnInit} from '@angular/core';
import {AccountService} from "../service/account/account.service";
import {AbstractControl, FormControl, FormGroup, Validators} from "@angular/forms";

@Component({
    selector: 'app-change-password',
    templateUrl: './change-password.component.html',
    styleUrls: ['./change-password.component.css']
})
export class ChangePasswordComponent implements OnInit {
    changeType: String = "password";
    check: number = 1;
    id!: number;
    formChangePassword!:any;

    constructor(private accountService: AccountService) {
    }



    ngOnInit() {
        this.formChangePassword= new FormGroup({
            password: new FormControl('', [Validators.required,this.checkPassword(control.value,"asdas")),
            newPassword: new FormControl(''),
            reCheckNewPassword: new FormControl(''),
        })
    }
    validation_messages = {
        password: [
            {type: 'required', message: 'Please enter your password.'},
            {type: 'checkPass', message: 'Password fail'}
        ],
        newPassword: [
            {type: 'required', message: 'Please select date of birth.'},
            {type: 'checkAge', message: 'Age must be 18 years old.'}
        ],
        reCheckNewPassword: [
            {type: 'required', message: 'Please enter your email.'},
            {
                type: 'pattern',
                message: 'Please enter your email in the format abc@xyz.jqk!'
            }
        ],
    };
    funcShowPassword() {
        if (this.check == 1) {
            this.changeType = "text";
            this.check = 2;
        } else {
            this.changeType = "password";
            this.check = 1;
        }
    }
    checkPassword(control: AbstractControl,passwordDb:string) {
        this.id = this.accountService.getAccountToken().id;
            const passwordIn = control.value;
            if (passwordIn!=passwordDb) {
                return {checkPass: true};
            }
            return null;
    }
}
